import DescriptionTwo from "./DescriptionTwo";

export default function Home() {
  return (
    <div className="row">
      <div className="column-3">
        <h3> Description</h3>
        <Datagraph />
        <Description />
        <DescriptionTwo />
      </div>
    </div>
  );
}
